import{_ as t,a as o,b as n,c as i,d as s}from"./chunks/hovergames_colored_small.B7z1rbKS.js";import{_ as l,c as p,j as r,a as d,G as c,a8 as h,B as u,o as m}from"./chunks/framework.BDnHobkS.js";const x=JSON.parse('{"title":"NXP RDDRONE-FMUK66 FMU (Discontinued)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/nxp_rddrone_fmuk66.md","filePath":"uk/flight_controller/nxp_rddrone_fmuk66.md"}'),f={name:"uk/flight_controller/nxp_rddrone_fmuk66.md"};function g(b,e,k,w,D,_){const a=u("Badge");return m(),p("div",null,[e[0]||(e[0]=r("h1",{id:"nxp-rddrone-fmuk66-fmu-discontinued",tabindex:"-1"},[d("NXP RDDRONE-FMUK66 FMU (Discontinued) "),r("a",{class:"header-anchor",href:"#nxp-rddrone-fmuk66-fmu-discontinued","aria-label":'Permalink to "NXP RDDRONE-FMUK66 FMU (Discontinued)"'},"​")],-1)),c(a,{type:"info",text:"Discontinued"}),e[1]||(e[1]=h('<div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This flight controller has been <a href="./../flight_controller/autopilot_experimental.html">discontinued</a> and is no longer commercially available.</p></div><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 не розробляє цей (або будь-який інший) автопілот. Contact the <a href="https://www.nxp.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>RDDRONE-FMUK66 FMU - це еталонний дизайн, який використовує компоненти NXP Semiconductor із тісною відповідністю специфікаціям Pixhawk FMUv4, додавши двохжильний автомобільний Ethernet 100BASET1 та безпечний елемент A71CH (RevC) або SE050 (RevD). NXP надає схеми, гербери, BOM та вихідні файли, щоб будь-хто міг відтворити, змінити або використати цей дизайн для інших цілей.</p><p>This is the official FMU for use with <a href="https://www.hovergames.com/" target="_blank" rel="noreferrer">HoverGames</a>.</p><p><img src="'+t+'" alt="RDDRONE-FMUK66 FMU Hero Image1"></p><p><img src="'+o+'" alt="RDDRONE-FMUK66 FMU Hero Image2"></p><p>NXP FMU та включені периферійні пристрої були протестовані на відповідність директивам FCC/CE/RoHs/REACH.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>These flight controllers are <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h2 id="короткии-опис" tabindex="-1">Короткий опис <a class="header-anchor" href="#короткии-опис" aria-label="Permalink to &quot;Короткий опис&quot;">​</a></h2><ul><li><strong>Main FMU Processor:</strong><ul><li>Мікроконтролер Kinetis K66 MK66FN2MOVLQ18 працює на частоті 180 МГц Cortex-M4F MCU, 2 МБ флеш-пам&#39;яті, 256 КБ SRAM, два USB (FS + HS), Ethernet, 144-LQFP.</li></ul></li><li><strong>On-board sensors:</strong><ul><li>Акселерометр/гіроскоп: BMI088/ICM42688 (RevD)...</li><li>Акселерометр/Магнітометр: FXOS8700CQ</li><li>Гіроскоп: FXAS21002CQ</li><li>Magnetometer: BMM150</li><li>Барометр: ML3115A2</li><li>Барометр: BMP280</li></ul></li><li><strong>GPS:</strong><ul><li>u-blox Neo-M8N GPS/GLONASS приймач; інтегрований магнетометр IST8310</li></ul></li></ul><p>This FMU is provided only as a kit, and includes <a href="https://www.segger.com/products/debug-probes/j-link/models/j-link-edu-mini/" target="_blank" rel="noreferrer">Segger Jlink EDU mini debugger</a>, DCD-LZ debugger adapter, USB-TTL-3V3 console cable, HolyBro GPS module, battery power module, SDCard and case, screws and stickers. Telemetry radios (<a href="https://www.nxp.com/part/HGD-TELEM433" target="_blank" rel="noreferrer">HGD-TELEM433</a> and <a href="https://www.nxp.com/part/HGD-TELEM915" target="_blank" rel="noreferrer">HGD-TELEM915</a>) must be purchased separately to match ISM band frequencies used in your country.</p><p><img src="'+n+'" alt="RDDRONE-FMUK66 FMU Kit"></p><p>A &quot;Lite&quot; version RDDRONE-FMUK66L is also available which does not include the power module, GPS, Jlink or USB-TTL-3V3 console cable or SDCard.<a href="https://www.nxp.com/design/designs/px4-robotic-drone-fmu-rddrone-fmuk66:RDDRONE-FMUK66#buy" target="_blank" rel="noreferrer">Scroll down to see FMUK66L in the buy section of the FMUK66 buy page</a></p><p>Additional information can be found in the <a href="https://www.nxp.com/design/designs/px4-robotic-drone-fmu-rddrone-fmuk66:RDDRONE-FMUK66" target="_blank" rel="noreferrer">Technical Data Sheet</a>. </p><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><p><strong>RDDRONE-FMUK66</strong> reference design kit may be purchased direct from NXP or from any of NXP&#39;s authorised worldwide network of <a href="https://www.nxp.com/support/sample-and-buy/distributor-network:DISTRIBUTORS" target="_blank" rel="noreferrer">electronics distributors</a>.</p><ul><li><a href="https://www.nxp.com/design/designs/px4-robotic-drone-fmu-rddrone-fmuk66:RDDRONE-FMUK66#buy" target="_blank" rel="noreferrer">Purchase Link</a> (www.nxp.com)</li><li>Телеметричні радіопередавачі придбаються окремо в залежності від частотного діапазону: <ul><li><a href="https://www.nxp.com/part/HGD-TELEM433" target="_blank" rel="noreferrer">HGD-TELEM433</a></li><li><a href="https://www.nxp.com/part/HGD-TELEM915" target="_blank" rel="noreferrer">HGD-TELEM915</a></li></ul></li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p><em>RDDRONE-FMUK66</em> FMU is also included in the complete HoverGames drone kit: <a href="https://www.nxp.com/applications/solutions/industrial/aerospace-and-mobile-robotics/uavs-drones-and-rovers/nxp-hovergames-drone-kit-including-rddrone-fmuk66-and-peripherals:KIT-HGDRONEK66#buy" target="_blank" rel="noreferrer">KIT-HGDRONEK66</a></p></div><h2 id="зборка-інсталяція" tabindex="-1">Зборка/інсталяція <a class="header-anchor" href="#зборка-інсталяція" aria-label="Permalink to &quot;Зборка/інсталяція&quot;">​</a></h2><p><a href="https://nxp.gitbook.io/hovergames" target="_blank" rel="noreferrer">https://nxp.gitbook.io/hovergames</a></p><h2 id="збірка-прошивки" tabindex="-1">Збірка прошивки <a class="header-anchor" href="#збірка-прошивки" aria-label="Permalink to &quot;Збірка прошивки&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make nxp_fmuk66-v3_default</span></span></code></pre></div><h2 id="відладочнии-порт" tabindex="-1">Відладочний порт <a class="header-anchor" href="#відладочнии-порт" aria-label="Permalink to &quot;Відладочний порт&quot;">​</a></h2><p>The <a href="./../debug/system_console.html">PX4 System Console</a> and the <a href="./../debug/swd_debug.html">SWD interface</a> run on the <a href="https://nxp.gitbook.io/hovergames/rddrone-fmuk66/connectors/debug-interface-dcd-lz" target="_blank" rel="noreferrer">DCD-LZ FMU Debug</a> port.</p><p>NXP&#39;s DCD-LZ is a 7 pin JST-GH connector and adds the nRST/MCU_RESET pin to the <a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-009%20Pixhawk%20Connector%20Standard.pdf" target="_blank" rel="noreferrer">Pixhawk 6-Pin standard debug port</a>.</p><p>Адаптер DCD-LZ дозволяє використовувати стандартний інтерфейс JTAG/SWD з 10 контактами (тобто за допомогою Segger Jlink) та стандартний кабель типу FTDI USB-TTL-3V3 з 5 контактами.</p><h2 id="підтримувані-платформи-конструкціі" tabindex="-1">Підтримувані платформи / Конструкції <a class="header-anchor" href="#підтримувані-платформи-конструкціі" aria-label="Permalink to &quot;Підтримувані платформи / Конструкції&quot;">​</a></h2><p>Будь-який мультикоптер / літак / наземна платформа / човен, який може керуватися звичайними RC сервоприводами або сервоприводами Futaba S-Bus. The complete set of supported configurations can be seen in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><p><img src="'+i+'" alt="HoverGames Drone Kit"></p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The NXP <a href="https://www.nxp.com/kit-hgdronek66" target="_blank" rel="noreferrer">HoverGames Drone Kit</a> (shown above) is a complete drone development kit that includes everything needed to build a quadcopter. Вам потрібно лише поставити акумулятор LiPo 3S/4S.</p></div><h2 id="подальша-інформація" tabindex="-1">Подальша інформація <a class="header-anchor" href="#подальша-інформація" aria-label="Permalink to &quot;Подальша інформація&quot;">​</a></h2><ul><li><p><a href="https://nxp.gitbook.io/hovergames" target="_blank" rel="noreferrer">HoverGames online documentation</a> PX4 user and programming guide, specific assembly, construction, debugging, programming instructions.</p></li><li><p>3DModels supporting HoverGames and RDDRONE-FMUK66 can be found on <em>Thingiverse</em> at these search links: <a href="https://www.thingiverse.com/search?q=fmuk66&amp;type=things&amp;sort=relevant" target="_blank" rel="noreferrer">fmuk66</a>, <a href="https://www.thingiverse.com/search?q=hovergames&amp;type=things&amp;sort=relevant" target="_blank" rel="noreferrer">hovergames</a>.</p></li></ul><p><img src="'+s+'" alt="HoverGamesDronelogo"></p>',35))])}const R=l(f,[["render",g]]);export{x as __pageData,R as default};
